import React from "react";
import { InnerItems } from "./style";
import Buttons from './../../../../Component/Button';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
const InnerItem = props => {
    const { item, location } = props;
    const { titleTabs } = item;
    const handleToPage = () => {
        const {history} = location;
        history.push(`/`)
    }
    return (
        <InnerItems className="inner-item col-lg-3 col-md-6">
             <Buttons name="Xem sản phẩm" type="view" className="btn btn-dark view" onClick = {handleToPage}/>
            <h4 className="name-inner">
                {titleTabs}
            </h4>
            
           
        </InnerItems>
    );
}
export default InnerItem;
